import {useState} from 'react';
import {Presentational as PresentationalHistoryBooks} from './presentational';
export const Container=()=>{
    const [rows, setRows] = useState([
        {titulo: "Cáscara de nuez", fecha_prestamo: "Mayo 22 2020", fecha_entrega: "Abril 01 2020"}
        ,{titulo: "Nosotros en la noche", fecha_prestamo: "Enero 05 2021", fecha_entrega: "Enero 12 2021"}
    ]);
    return(
        <div>
            <PresentationalHistoryBooks 
                history={rows} 
            />
        </div>
    )
}
